-- Minimum participation ckeck on : T1227
CREATE OR REPLACE FUNCTION "PDRO".T1227_checkParticipationMin(_T0a87_uid "PDRO"."uid_domain")
  RETURNS BOOLEAN AS
$$
BEGIN
  IF
  (
    (
      SELECT COUNT(*)
      FROM "PDRO"."T1227"
      WHERE "T0a87_uid" = _T0a87_uid
    ) >= 1
  )
  THEN
    RETURN TRUE;
  ELSE
    RAISE NOTICE 'Participation  %  does not respect minimum value %', 'T1227', 1;
    RETURN FALSE;
  END IF;
END;
$$
LANGUAGE 'plpgsql';

